import React from 'react';
import './Games.css';

const games = [
    { id: 1, name: "Assasin Creed BlackFlag", description: "Description of Game 1", image: "assasinblack.jpg" },
    { id: 2, name: "Assasin Creed BrotherHood", description: "Description of Game 2", image: "assasinbrother.webp" },
    { id: 3, name: "Assasin Creed Mirage", description: "Description of Game 50", image: "assasinmirage.jpg" },
    { id: 4, name: "Assasin Creed Valhalla", description: "Description of Game 50", image: "assasinvalhalla.png" },
    { id: 5, name: "Assasin Creed Odyssey", description: "Description of Game 50", image: "assasinodyssey.jpg" },
    { id: 6, name: "Assasin Creed Origin", description: "Description of Game 50", image: "assasinorigin.jpg" },
    { id: 7, name: "Elden Ring", description: "Description of Game 50", image: "eldenring.jpg" },
    { id: 8, name: "Forza Horizon 5", description: "Description of Game 50", image: "forza.jpg" },
    { id: 9, name: "Hogwarts Legacy", description: "Description of Game 50", image: "hogwartslegacy.jpg" },
    { id: 10, name: "Red Dead Redemption 2", description: "Description of Game 50", image: "rdr2.jpg" },
    { id: 11, name: "Mortal Kombat 1", description: "Description of Game 50", image: "mortalkombat.jpg" },
    { id: 12, name: "Last Of Us Part 1", description: "Description of Game 50", image: "lastofus.jpg" },
    { id: 13, name: "Resident Evil Bio:Hazard", description: "Description of Game 50", image: "rebio.jpg" },
    { id: 14, name: "Watch Dog Legion", description: "Description of Game 50", image: "watchdog.jpg" },
    { id: 15, name: "Valorant", description: "Description of Game 50", image: "valorant.jpg" },
    { id: 16, name: "GTA 5", description: "Description of Game 50", image: "gta5.jpg" },
    { id: 17, name: "Game 3", description: "Description of Game 50", image: "/images/game50.jpg" },
    { id: 18, name: "Game 3", description: "Description of Game 50", image: "/images/game50.jpg" },
];

const Games = () => {
    return (
        <div className="games">
            <h2>PS5 and PC Games</h2>
            <div className="games-list">
                {games.map(game => (
                    <div key={game.id} className="game-item">
                        <img src={game.image} alt={game.name} />
                        <h3>{game.name}</h3>
                        <p>{game.description}</p>
                        <button className="buy-now">Buy Now</button>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Games;
